package fastjson_test

import (
	"testing"

	"github.com/fastjson"
)

func TestVisit(t *testing.T) {
	// Define test JSON object for testing Visit function
	obj := &fastjson.Object{
		kvs: []kv{
			{"key1", &fastjson.Value{
				o: fastjson.Object{
					kvs: []kv{
						{"innerKey1", &fastjson.Value{t: fastjson.TypeString, s: "value1"}},
						{"innerKey2", &fastjson.Value{t: fastjson.TypeNumber}},
					},
				},
			}},
			{"key2", &fastjson.Value{t: fastjson.TypeTrue}},
			{"key3", &fastjson.Value{t: fastjson.TypeFalse}},
		},
	}

	// Define expected keys and value types in the original order
	expectedKeys := []string{"key1", "key2", "key3"}
	expectedTypes := []fastjson.Type{fastjson.TypeObject, fastjson.TypeTrue, fastjson.TypeFalse}

	// Define a slice to capture visited keys
	visitedKeys := make([]string, 0)

	// Perform the Visit operation on the test object
	obj.Visit(func(key []byte, v *fastjson.Value) {
		visitedKeys = append(visitedKeys, string(key))
	})

	// Check if the visited keys match the expected keys in the original order
	for i, key := range visitedKeys {
		if key != expectedKeys[i] {
			t.Errorf("Expected key %s at index %d, but got %s", expectedKeys[i], i, key)
		}
	}

	// Check if the visited value types match the expected types in the original order
	for i, kv := range obj.kvs {
		if kv.v.t != expectedTypes[i] {
			t.Errorf("Expected type %s for key %s, but got %s", expectedTypes[i], kv.k, kv.v.t)
		}
	}
}

