	if v1.t != v2.t {
		return false
	}

	if v1.s != v2.s {
		return false
	}

	if len(v1.a) != len(v2.a) {
		return false
	}

	for i, val := range v1.a {
		if !compareValues(val, v2.a[i]) {
			return false
		}
	}

	return true
}

