// helper function to compare errors properly
func errorsIsEqual(err1, err2 error) bool {
	if (err1 == nil) != (err2 == nil) {
		return false
	}

	// at this point, either both errors are nil or both are not nil
	if err1 != nil && err2 != nil && err1.Error() != err2.Error() {
		return false
	}

	return true
}

