package fastjson

import (
	"fmt"
	"testing"
)

func TestParseObject(t *testing.T) {
	// Test cases
	tests := []struct {
		input       string
		outputValue *Value
		outputRest  string
		outputError error
	}{
		{`{"key":"value"}`, &Value{
			t: TypeObject,
			o: Object{
				kvs: []kv{{k: "key", v: &Value{t: TypeString, s: "value"}}},
			},
		}, "", nil},
		{`{"num":123}`, &Value{
			t: TypeObject,
			o: Object{
				kvs: []kv{{k: "num", v: &Value{t: TypeNumber, s: "123"}}},
			},
		}, "", nil},
		{`{"arr":[1,2,3]}`, &Value{
			t: TypeObject,
			o: Object{
				kvs: []kv{{k: "arr", v: &Value{t: TypeArray, a: []*Value{
					{t: TypeNumber, s: "1"},
					{t: TypeNumber, s: "2"},
					{t: TypeNumber, s: "3"},
				}}},
				},
			},
		}, "", nil},
		{`{"bool_true":true}`, &Value{
			t: TypeObject,
			o: Object{
				kvs: []kv{{k: "bool_true", v: &Value{t: TypeTrue}}},
			},
		}, "", nil},
		{`{"bool_false":false}`, &Value{
			t: TypeObject,
			o: Object{
				kvs: []kv{{k: "bool_false", v: &Value{t: TypeFalse}}},
			},
		}, "", nil},
	}

	for _, tt := range tests {
		c := &cache{vs: make([]Value, 0)}
		value, rest, err := parseObject(tt.input, c, 0)

		// Check if value matches the expected output
		if err != tt.outputError {
			t.Errorf("Expected error: %v, got: %v", tt.outputError, err)
		}
		if rest != tt.outputRest {
			t.Errorf("Expected rest: %s, got: %s", tt.outputRest, rest)
		}
		if !valueEquals(value, tt.outputValue) {
			t.Errorf("Expected value: %v, got: %v", tt.outputValue, value)
		}
	}
}

func valueEquals(v1, v2 *Value) bool {
	if v1.t != v2.t {
		return false
	}
	switch v1.t {
	case TypeObject:
		if len(v1.o.kvs) != len(v2.o.kvs) {
			return false
		}
		for i := 0; i < len(v1.o.kvs); i++ {
			if v1.o.kvs[i].k != v2.o.kvs[i].k || !valueEquals(v1.o.kvs[i].v, v2.o.kvs[i].v) {
				return false
			}
		}
		return true
	case TypeArray:
		if len(v1.a) != len(v2.a) {
			return false
		}
		for i := 0; i < len(v1.a); i++ {
			if !valueEquals(v1.a[i], v2.a[i]) {
				return false
			}
		}
		return true
	case TypeString:
		return v1.s == v2.s
	case TypeNumber, TypeTrue, TypeFalse:
		return true
	default:
		return false
	}
}

