func TestParse(t *testing.T) {
	parser := &Parser{}

	t.Run("Valid JSON", func(t *testing.T) {
		jsonStr := `{"key": "value"}`
		expectedValue := &Value{
			o: Object{
				kvs: []kv{
					{
						k: "key",
						v: &Value{s: "value", t: TypeString},
					},
				},
				keysUnescaped: true,
			},
			t: TypeObject,
		}

		result, err := parser.Parse(jsonStr)

		if err != nil {
			t.Errorf("Unexpected error: %v", err)
		}

		if result.t != expectedValue.t {
			t.Errorf("Expected value type %v, got %v", expectedValue.t, result.t)
		}

		obj1 := result.o
		obj2 := expectedValue.o
		if len(obj1.kvs) != len(obj2.kvs) {
			t.Errorf("Expected number of key-value pairs %d, got %d", len(obj2.kvs), len(obj1.kvs))
		} else {
			for i := 0; i < len(obj1.kvs); i++ {
				if obj1.kvs[i].k != obj2.kvs[i].k {
					t.Errorf("Expected key %s, got %s", obj2.kvs[i].k, obj1.kvs[i].k)
				}
				if obj1.kvs[i].v.s != obj2.kvs[i].v.s {
					t.Errorf("Expected value %s, got %s", obj2.kvs[i].v.s, obj1.kvs[i].v.s)
				}
				if obj1.kvs[i].v.t != obj2.kvs[i].v.t {
					t.Errorf("Expected value type %v, got %v", obj2.kvs[i].v.t, obj1.kvs[i].v.t)
				}
			}
		}
	})

	t.Run("Invalid JSON", func(t *testing.T) {
		jsonStr := `{"key": "value",}`
		expectedErr := "unexpected tail: ','"

		_, err := parser.Parse(jsonStr)

		if err == nil {
			t.Error("Expected error, got nil")
		}

		if err.Error() != expectedErr {
			t.Errorf("Expected error message '%s', got '%s'", expectedErr, err.Error())
		}
	})
}

