		{input: "too big JSON object...", expectedError: fmt.Errorf("too big depth for the nested JSON; it exceeds %d", fastjson.MaxDepth)},
		// Add more test cases here
	}

	cache := &fastjson.Cache{}
	depth := 0

	for _, tc := range testCases {
		_, _, err := fastjson.ParseValue(tc.input, cache, depth)
		if err == nil {
			t.Errorf("Expected error %v for input %s, but got no error", tc.expectedError, tc.input)
		} else if err.Error() != tc.expectedError.Error() {
			t.Errorf("Expected error %v for input %s, but got %v", tc.expectedError, tc.input, err)
		}
	}
}

