package fastjson

import (
	"testing"
)

func TestParseRawNumber(t *testing.T) {
	samples := []struct {
		input         string
		expectedFirst string
		expectedRest  string
		expectedError bool
	}{
		{"123.45", "123.45", "", false},
		{"-543.21", "-543.21", "", false},
		{"1.23e4", "1.23e4", "", false},
		{"-4.56E-7", "-4.56E-7", "", false},
		{"infinit" , "", "infinit", true},
		{"nan" , "", "nan", true},
		{"abc", "", "abc", true},
	}

	for _, sample := range samples {
		first, rest, err := parseRawNumber(sample.input)

		if first != sample.expectedFirst || rest != sample.expectedRest {
			t.Errorf("For input %q, got (%q, %q), expected (%q, %q)", sample.input, first, rest, sample.expectedFirst, sample.expectedRest)
		}

		if (err != nil) != sample.expectedError {
			t.Errorf("For input %q, unexpected error: %v", sample.input, err)
		}
	}
}
